import React from "react";
import capitalize from "../capitalize"

const FullRecord = (props) => {
    return (
        <div style={{ border: '2px solid rgba(0, 0, 100, 0.5)', padding: '10px' }}>
            <strong>Имя: </strong> {capitalize(props.rec.person.full_name)}, <strong>телефон:</strong> {props.rec.person.phone}, <strong>email: </strong> {props.rec.person.email} <br />
            {/* <strong>Город: </strong> {props.rec.address.city}, <strong>улица:</strong> {props.rec.address.street}, <strong>дом:</strong> {props.rec.address.house}, 
            <strong>подъезд:</strong>, {props.rec.address.entrance}, <strong>этаж:</strong> {props.rec.address.floor}, <strong>квартира:</strong> {props.rec.address.office},
            <strong>домофон:</strong> {props.rec.address.door_code} */}
            <strong>сумма заказа: </strong> {props.rec.amount_charged}, <strong>дата заказа: </strong> {props.rec.created_at} <br />
            <strong>комментарий: </strong> {props.rec.address_comment}, <br />
        </div>
    );
};

export default FullRecord;
